import React from 'react';

import CardPedido from '../../components/CardPedido';

const listaPedidos = [
    {
        numeroPedido: 1,
        mesa: 1,
        itens: [
            {
                produto: 'Batata frita',
                quantidade: null,
                porcao: 'grande'
            },
            {
                produto: 'Refri',
                quantidade: null,
                porcao: 'lata'
            },
        ],
        tempoEspera: 15
    },
    {
        numeroPedido: 1,
        mesa: 1,
        itens: ['Pizza', 'Refri 1 litro'],
        tempoEspera: 15
    },
    {
        numeroPedido: 1,
        mesa: 1,
        itens: ['Salada', 'suco'],
        tempoEspera: 15
    },
    {
        numeroPedido: 1,
        mesa: 1,
        itens: ['Hamburguer', 'cerveja'],
        tempoEspera: 15
    }
];

export default function CozinhaContent() {
    return (
        <div className="content-wrapper">

            {/* Content Header (Page header) */}
            <section className="content-header">
                <div className="container-fluid">
                    <div className="row mb-2">
                        <div className="col-sm-6">
                            <h1>Lista de pedidos</h1>
                        </div>
                        <div className="col-sm-6">
                            <ol className="breadcrumb float-sm-right">
                                <li className="breadcrumb-item"><a href="#">Home</a></li>
                                <li className="breadcrumb-item active">Main</li>
                            </ol>
                        </div>
                    </div>
                </div>{/* /.container-fluid */}
            </section>

            {/* Main content */}
            <section className="content">
                {/* Default box */}
                <div className="card card-solid">
                    <div className="card-body pb-0">
                        <div className="row d-flex align-items-stretch">

                            <CardPedido mesa={1} pedido={1} itens={['Hamburguer', 'cerveja']} />

                        </div>
                    </div>
                    {/* /.card-body */}
                    <div className="card-footer">
                        <nav aria-label="Contacts Page Navigation">
                            <ul className="pagination justify-content-center m-0">
                                <li className="page-item active"><a className="page-link" href="#">1</a></li>
                                <li className="page-item"><a className="page-link" href="#">2</a></li>
                                <li className="page-item"><a className="page-link" href="#">3</a></li>
                                <li className="page-item"><a className="page-link" href="#">4</a></li>
                                <li className="page-item"><a className="page-link" href="#">5</a></li>
                                <li className="page-item"><a className="page-link" href="#">6</a></li>
                                <li className="page-item"><a className="page-link" href="#">7</a></li>
                                <li className="page-item"><a className="page-link" href="#">8</a></li>
                            </ul>
                        </nav>
                    </div>
                    {/* /.card-footer */}
                </div>
                {/* /.card */}
            </section>
            {/* /.content */}


        </div>
    );
}
